async function validate(){
  /* Write your custom code here. For more infromation 
     checkout SDK docs here at, https://docs.public.dev/sdk */

  const appUrl = new URL(await crusherSdk.page.url());
  const backendAPIUrl = appUrl.host === "app.public.dev" ? "https://backend.public.dev/tests/" : "/server/tests/";

  await crusherSdk.page.evaluate(([backendAPIUrl]) => {
      const testCardLinks = [...document.querySelectorAll("a")].filter((node) => (node.href.startsWith("crusher://")));
      const testCardLinkUrl = new URL(testCardLinks[0].href);
      const testCardId = testCardLinkUrl.searchParams.get("testId");

      function isTestFinished(testId) {
        return fetch(backendAPIUrl + testId).then((res) => {
            return res.json();
        }).then((res) => (!!res.hasFirstRunCompleted)).catch((err) => (false));
      }

      // Check isTestFinished iteratively every 5s one at a time with a timeout of 2mins
      function checkTestFinished(testId, timeout) {
        return new Promise((resolve, reject) => {
            let interval = setInterval(() => {
                isTestFinished(testId).then((res) => {
                    if (res) {
                        clearInterval(interval);
                        resolve(res);
                    }
                });
            }, 5000);

            setTimeout(() => {
                clearInterval(interval);
                reject("Timeout");
            }, timeout);
        });
      }

	  return checkTestFinished(testCardId, 120000);
  }, [backendAPIUrl]);
}

